geregisseerd door Paco Cabezas
met Rachel Nichols, Nicolas Cage en Peter Stormare

Paul Maguire (Nicolas Cage) en zijn vrienden Kane (Max Ryan) en Doherty (Michael McGrady) leven in een wereld van criminaliteit. Op een nacht lokken ze een Russische gangster in de val die op weg is om geld naar zijn baas te brengen. De opbrengst is groter dan ze dachten en met een koffer vol geld en een Tokarev (Russische wapen) vluchten ze. De misdaad zorgt echter voor een langdurige oorlog tussen hun Ierse familie en de Russische maffia. Jaren later, wanneer Paul zijn criminele verleden achter zich heeft gelaten en een gezin gesticht heeft, wordt zijn dochter ontvoerd.


